import React from 'react';
import './index.scss';

export default function CheckoutPage() {
    return (
        <div className='checkout-page'>
            <div className='checkout-header'>
                <div className="header-block">
                    <span>Product</span>
                </div>
            </div>
        </div>
    )
}
